     // 添加class
    function addClass(elm, className) {
        function addClassSingle(obj, className){
            if (obj.className === '') {
                obj.className = className;
            } else {
                var arrClassName = obj.className.split(' ');
                if (arrIndexOf(arrClassName, className) === -1) {
                    obj.className += ' ' + className;
                }
            }
        }
        if(elm instanceof HTMLCollection){
            for(var i = 0;i <elm.length;i++){
                addClassSingle(elm[i], className);
            }
        }else{
            addClassSingle(elm, className)
        }
    }
    function hasClass(obj, className) {
        if (obj.className != '' && (typeof(obj.className) === 'string')) {
            var arrClassName = obj.className.split(' ');
            var classIndex = arrIndexOf(arrClassName, className);
            if (classIndex!==-1) {
                return true;
            }
            return false;
        }
        return false;
    }
    // 删除class
    function removeClass(elm, className) {
        function removeClassSingle(obj, className) {
            if (obj.className != '') {
                var arrClassName = obj.className.split(' ');
                var classIndex = arrIndexOf(arrClassName, className);
                if (classIndex!==-1) {
                    arrClassName.splice(classIndex, 1);
                    obj.className = arrClassName.join(' ');
                }
            }
        }
        if(elm instanceof HTMLCollection){
            for(var i = 0;i <elm.length;i++){
                removeClassSingle(elm[i], className);
            }
        }else{
            removeClassSingle(elm, className)
        }
    }
    // 设置cookie
    function setCookie(name,value,days) {
        var domain, domainParts, date, expires, host;
        if (days)
        {
            date = new Date();
            date.setTime(date.getTime()+(days*24*60*60*1000));
            expires = "; expires="+date.toGMTString();
        }
        else
        {
            expires = "";
        }
        var _isValidIP = isValidIP(location.hostname);
        if(_isValidIP){
            document.cookie = name+"="+value+expires+"; path=/";
            return;
        }
        host = location.host;
        if (host.split('.').length === 1)
        {
            // no "." in a domain - it's localhost or something similar
            document.cookie = name+"="+value+expires+"; path=/";
        }
        else
        {
            // Remember the cookie on all subdomains.
            //
            // Start with trying to set cookie to the top domain.
            // (example: if user is on foo.com, try to set
            //  cookie to domain ".com")
            //
            // If the cookie will not be set, it means ".com"
            // is a top level domain and we need to
            // set the cookie to ".foo.com"
            domainParts = host.split('.');
            var len = domainParts.length;
            if(len > 2 && name === JWT_KEY){
                domain = domainParts[len-2] + '.' + domainParts[len-1];
            }else{
                domainParts.shift();
                domain = domainParts.join('.');
            }

            document.cookie = name+"="+value+expires+"; path=/; domain="+domain;

            // check if cookie was successfuly set to the given domain
            // (otherwise it was a Top-Level Domain)
            // if (getCookie(name) == null ||getCookie(name) != value)
            // {
            //     // append "." to current domain
            //     domain = host;
            //     document.cookie = name+"="+value+expires+"; path=/; domain="+domain;
            // }
        }
    }
    // 读取cookie
    function getCookie(name) {
        var arr,reg=new RegExp("(^| )"+name+"=([^;]*)(;|$)");
        if(arr=document.cookie.match(reg))
            return unescape(arr[2]);
        else
            return null;
    }
    // 删除cookie
    function removeCookie(name) {
        setCookie(name, '', -1);
    }
