    // 生成degist
    function createDigest(callback, errorCallback) {
        var obj = {};
        var tenant = getCurrentTenant();
        var user = getUserInfo();
        obj.email = user.email;
        obj.tenant_id = tenant.id;
        obj.tenant_name = tenant.name;
        obj.tenant_short_name = tenant.shortName;
        obj.user_id = user.user_id;
        obj.user_token = user.user_token;
        obj.username = user.username;
        obj.user_short_name = user.short_name;
        obj.open_id = user.iam_openid;
        obj.user_mobile = user.phone_number;
        function digestCallback(res){
            setCookie(DIGEST_KEY, res);
            if(typeof callback === 'function'){
                callback(res);
            }
        }
        ajax({
            // url: USER_COMMON_API + '/v1/digest',
            // url: 'http://mt-service-user8093.cspv2.njpk-uat-a.sxc.sh/user/digest/actions',
            // url: NEW_BASE_URL + 'user/digest/actions',
            url: NEW_BASE_URL + 'v1/digest',
            type: 'POST',
            data: {encrpyt: getAes(JSON.stringify(obj))},
            successCallback: digestCallback,
            error: errorCallback
        });
    }
    function getAes(data) {
        var key  = CryptoJS.enc.Utf8.parse('QAZWSXEDC2019VBN');
        var iv   = CryptoJS.enc.Utf8.parse('2019VBNQWERTYUIO');
        var encrypted = CryptoJS.AES.encrypt(data, key,
          {
            iv:iv,
            mode:CryptoJS.mode.CBC,
            padding:CryptoJS.pad.ZeroPadding
          });
        return encrypted.toString();
    }
    function decodeAes(data) {
        var key  = CryptoJS.enc.Utf8.parse('QAZWSXEDC2019VBN');
        var iv   = CryptoJS.enc.Utf8.parse('2019VBNQWERTYUIO');
        var decrypt = CryptoJS.AES.decrypt(data,key,
          {
              iv:iv,
              mode:CryptoJS.mode.CBC,
              padding:CryptoJS.pad.ZeroPadding
          });
        return decrypt.toString(CryptoJS.enc.Utf8);
    }
