    // 获取登录用户信息
    function getUserInfo() {
        var jwt =  getJWT();
        if(!jwt){
            jumpToLoginPage();
            return;
        }
        var info_str= jwt.split('.')[1];
        try {
            if(info_str.length>0){
                var str = Base64.decode(info_str).replace(/}.*/,'}');
                return JSON.parse(str);
            }
        } catch (e) {
            return null;
        }
    }
