    // 导航头菜单点击记录
    function recordClick(item, navType, target) {
        if (item.menuId === 'm_logout') {
            logout();
            return;
        }
        ajax({
            url: SERVICE_OPEN_API + '/api/v1/service/check?tenantShortName='+getCurrentTenant().shortName+'&serviceKey='+item.menuId+'&timestemp='+urlTimestamp,
            type: 'GET',
            successCallback: function () {
                refreshRecentlyUsage(item);
                var tag = document.createElement("a");
                tag.href=target.getAttribute('data-to');
                if (navType === 1) {
                    tag.target="_blank";
                    document.body.appendChild(tag);
                    tag.click();
                    document.body.removeChild(tag);
                }else {
                    window.location.href = target.getAttribute('data-to')
                }
            },
            error: function (xhr, status) {
                refreshRecentlyUsage(item);
                if (status === 200) {
                    if (target.getAttribute('data-to').indexOf(SECURITY_URL) > -1) {
                        // 安全产品统一跳转他们的地址
                        window.location.href = target.getAttribute('data-to');
                    } else {
                        window.location.href = CONSOLE_DOMAIN + '/product/detail/'+item.serviceId+'/'+item.menuId+'/'+item.serviceId;
                    }
                }else {
                    window.location.href = target.getAttribute('data-to')
                }
            }
        });
    }
    // 记录点击菜单，刷新最近使用
    function refreshRecentlyUsage(item) {
        var params = {
            serviceId: item.serviceId,
            serviceLink: item.linkUrl,
            serviceLogo: item.icon,
            serviceName: item.name,
            tenantId: getCurrentTenant().shortName,
            serviceType: item.serviceType
        };
        ajax({
            url: DASHBOARD_API + '/dashboard/tenantUsage',
            type: 'POST',
            data: params
        });
    }
